int solve_old(string A) {
    int mod = 1e9 + 7;
      unsigned long long int aCount =0;
    vector<unsigned long long int> ps ={};
    ps.resize(A.size());
    if(A.at(0) == 'A'){
        ps[0] = 1;
    } else{
        ps[0] = 0;
    }

    for(unsigned long long int i = 1;i<A.size();i++){
        if(A.at(i) == 'A'){
            ps[i] = ps[i-1] + 1 ;
        }else{
            ps[i] = ps[i-1] ;
        }
    }

    //show(ps);
    for(unsigned long long int i =0;i<A.size();i++){
        if(A.at(i) == 'G'){
            aCount= (aCount + ps[i])%mod;
        }
    }
    return aCount;
}

int Solution::solve(string A) {
    int n = (int)A.length(), mod = 1e9 + 7;
    
    // create an array to store number of G's from i to n
    int count_G[n];
    
    // initialize the array with 0
    for(int i = 0; i < n; i += 1)
        count_G[i] = 0;
    
    // set the value of count_G[n - 1] equal to 1 if last character is G
    count_G[n - 1] = (A[n - 1] == 'G');
    // traverse the string from backward and count number of G's from i to n
    for(int i = n - 2; i > 0; i -= 1) {
        count_G[i] = count_G[i + 1] + (A[i] == 'G');
    }
    
    int ans = 0;
    // traverse the string again from beginning
    for(int i = 0; i < n - 1; i += 1) {
        // if current character is "A" then add number of G's after that 
        if(A[i] == 'A') {
            ans = (ans + count_G[i + 1]) % mod;
        }
    }
    // return the answer
    return ans;    
}

int Solution::solve(vector<int> &A) {
    int len = A.size();
    int max = *max_element(A.begin(),A.end());
    int min = *min_element(A.begin(), A.end());

    int minpos=-1;
    int maxpos=-1;

    int ans = len;

    for(int i =0;i<len;i++){
        if(A[i] == max){
            maxpos = i;
        }

        if(A[i]==min){
            minpos = i;
        }

        if(minpos !=-1 && maxpos != -1){
            ans = std::min(ans, abs(minpos - maxpos)+1);
        }
    }

    return ans;

}

